import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import HomeScreen from './src/screens/HomeScreen';
import ProfileScreen from './src/screens/ProfileScreen';
import SettingsScreen from './src/screens/SettingsScreen';
import ChangePasswordScreen from './src/screens/ChangePasswordScreen';
import ThemeScreen from './src/screens/ThemeScreen';
import LanguageScreen from './src/screens/LanguageScreen';

const Stack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Inicio" component={HomeScreen} />
        <Stack.Screen name="Mi Perfil" component={ProfileScreen} />
        <Stack.Screen name="Configuración" component={SettingsScreen} />
        <Stack.Screen name="Cambiar Contraseña" component={ChangePasswordScreen} />
        <Stack.Screen name="Tema" component={ThemeScreen} />
        <Stack.Screen name="Idioma" component={LanguageScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
